import axios from "axios"


const Home = () => {
    const url = 'https://api.coinstats.app/public/v1/coins?skip=0&limit=100&currency=AUD'
  return (
    <div>
        const [coins, setCoins] = useState([])

        
        useEffect(() => {
            axios.get(url).then((response) => {
                setCoins(response.data)

                }).catch((error) => {
                console.log(error)
                })
            }, [])






    </div>
  )
}

export default Home
